body.div:
			καὶ
εἶπεν Μωυσῆς πρὸς Τύριον Ἳνα τί ἐκάκωσας τὸν θεράποντά σου;
καὶ διὰ τί οὐχ εὕρηκα χάριν ἐναντίον σου, ἐπιθεῖναι τὴν ὁρμὴν τοῦ

			καὶ τῷ λαῷ ἐρεῖς Ἁγνίσασθε εἰς αὔριον, καὶ
κρέα· ὅτι ἐκλαύσατε ἔναντι κυρίου λέγοντες τίς ἡμᾶς ψωκρέα;
ὃτι καλὸν ἡμῖν ἐστὶν ἐν Αἰγύπτῳ· καὶ δώσει κύριος ὑμῖν

			καὶ ἐξεκκλησίασεν Μωυσῆς καὶ Ἀαρὼν τὴν συναγωγὴν
ἀπέναντι τῆς πέτρος, καὶ εἶπεν πρὸς αὐτούς Ἀκούσατέ μου,
οἱ ἀπειθεῖς· μὴ ἐκ τῆς πέτρας ταύτης ἐξάξομεν ὑμῖν ὕδωρ ;
